INSERT INTO producto VALUES(23,'Comedor Triangular Parker Chocolate','ZMAEKV2044','Atractivo comedor con cubierta de cristal templado de 10 mm de grosor y cubierta adicional tipo esmerilado en su parte baja. Estructura metálica de gran resistencia, en conjunto con sus sillas tapizadas en tacto piel y patas metálicas cromadas, hacen de este un gran conjunto para tu espacio.','Metal/Vidrio',2,8790,30,'Comedor para 6 personas','Se recomienda utilizar un paño limpio húmedo sólo con agua. Cualquier otro producto puede ir eliminando el brillo de la cubierta hasta dejarla opaca.','76x120x120','https://dico.com.mx/media/catalog/product/cache/ddfdab190e55251eefb307178e423bf7/p/a/parker_ketch_negro_comedor-zoom.jpg','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/c/o/comedor-moderna-cubierta-cafe-cristal-parker_com17924k0-c-f-01-w_1.jpg','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/c/o/comedor-moderna-cubierta-cafe-cristal-parker_com17924k0-c-d-02-w_1.jpg', NOW(), NOW());
INSERT INTO producto VALUES(24,'Silla Nora Cartier Beige 04 Fabricación Especial','ZMAEKV2045','Silla con estructura de madera sólida para comedor. Da el toque elegante a tu comedor con esta silla estilo clásico. Por su color, es muy fácil de combinar con distintos estilos y materiales. Respaldo y asiento suave, con relleno espuma.','Silla con estructura de madera sólida.',9,4995,31,'Asiento y respaldo con relleno espuma tapizado en tela color gris claro.','No utilizar solventes ni químicos, para evitar dañar la tela. Proteger del polvo y ambientes exteriores.','95, 56, 60','https://mobica.vtexassets.com/arquivos/ids/171462-800-auto?v=637333708641200000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/170690-800-auto?v=637242223511900000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/170691-800-auto?v=637242223805500000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(25,'Silla Blanca con ruedas Quincy','ZMAEKV2046','Silla de diseño y materiales vanguardistas, que por su forma y colores será un buen asiento para tu oficina o escrito de hogar. Con su altura regulable se adaptará a tus necesidades. Combínala con alguno de nuestros escritorios como el Atreo, para darle un estilo único a tu oficina.','Patas de acero inoxidable que por su resistencia a la corrosión tienen mayor durabilidad.',9,1745,27,'Altura regulable, adaptable a las dimensiones y necesidades del usuario','Evitar uso de solventes y cera Limpiar con limpiador de vidrios o espuma de jabón','90, 57, 61','https://mobica.vtexassets.com/arquivos/ids/162447-800-auto?v=636529268493300000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/167347-800-auto?v=636887165434830000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/167348-800-auto?v=636887165584330000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(26,'Silla Multiusos Lumi Azul','ZMAEKV2047','La silla Lumi es un elemento que no debe faltar en tu oficina. Su diseño ergonómico no solo brinda comodidad, también le da un toque de estilo a tu espacio laboral. Si se trata de proyectar modernidad y estilo, nuestra Silla Lumi con ruedas es la opción que estás buscando.','Estructura de Polipropileno en colores blanco, verde y rosa.',9,3500,24,'Base con regulación de altura con pistón de gas.','Limpiar con un paño húmedo.','73, 50, 54','https://mobica.vtexassets.com/arquivos/ids/165788-800-auto?v=636797322786770000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/165638-800-auto?v=636791979586170000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/165785-800-auto?v=636797322515670000&width=800&height=auto&aspect=true', NOW(), NOW());
