INSERT INTO producto VALUES(37,'Silla Kiev Aluminio Pata Negra','ZMAEKV2058','La mesa y las sillas de un comedor, son los protagonistas en cualquier cena, comida o reunión. Nuestra silla Kiev Aluminio, tiene un diseño elegante y sofisticado.Perfecta para que tus invitados y tú pasen momentos inolvidables. Diseño sobrio, elegante y moderno que le dará un estilo inolvidable a tu comedor.','Silla con estructura de madera sólida natural, respaldo y asiento relleno de espuma.',2,2995,29,'Acabado negro mate. Tapizada en tela.','Proteger del polvo y ambientes exteriores. En caso de limpieza, no utilizar solventes ni químicos.','90, 53, 60','https://mobica.vtexassets.com/arquivos/ids/170406-800-auto?v=637206081393170000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/170407-800-auto?v=637206081481530000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/170408-800-auto?v=637206081572570000&width=800&height=auto&aspect=true', NOW(), NOW());
