INSERT INTO producto VALUES(3,'Comedor Lemujie Nogal','ZMAEKV2024','Recibe a tus invitados como se merecen con el acogedor Comedor 106381-82 Nuez Coaster, un fino comedor hecho de Madera de Pino con un estilo contemporáneo y con acabados en Nogal. Este modelo cuenta con 6 sillas las cuales se encuentran tapizadas en tela.','Madera Pino',2,12890,25,'Comedor para 6 personas','Se recomienda utilizar un paño limpio húmedo sólo con agua. Cualquier otro producto puede ir eliminando el brillo de la cubierta hasta dejarla opaca.','97X50X58','https://www.mueblesamerica.mx/img/1024/1024/resize/2/0/201a00441_a.jpg','https://www.mueblesamerica.mx/img/1024/1024/resize/2/0/201a00441_b.jpg','https://www.mueblesamerica.mx/comedor-106381-82-nogal-201a00441.html?list=Tambi%C3%A9n%20te%20puede%20interesar', NOW(), NOW());
INSERT INTO producto VALUES(4,'Comedor PORTUGAL Mdf','ZMAEKV2025','Comer en familia siempre ah sido importante, por eso tenemos para ti este hermoso comedor modelo Portugal. Consta de un diseño sencillo pero elegante, sus colores combinaran con cualquier decoración. Incluye 2 sillas y una banca para dos personas fabricadas con materiales de excelente calidad, brindando una vista hogareña. La mesa/comedor cuenta con una cubierta de MDF proyectando un acabado moderno. Es ideal para ahorrar espacio. ¡Cómpralo en línea y sorprende a tu familia!MDF','MDF',2,4250,27,'Comedor para 4 personas','Se recomienda utilizar un paño limpio húmedo sólo con agua. Cualquier otro producto puede ir eliminando el brillo de la cubierta hasta dejarla opaca.','100X40X43','https://www.mueblesamerica.mx/img/1024/1024/resize/1/9/194a00212_a.jpg','https://www.mueblesamerica.mx/comedor-portugal-mdf-194a00212.html?list=Parrilla%20-%20Departamentos%2FMuebles%2FComedor%2FComedores%2FDefault%20Category', NOW(), NOW());
INSERT INTO producto VALUES(5,'Comedor SINGAPUR Laca De Poliuretano','ZMAEKV2026','Renueva tu hogar con las mejores tendencias, encuentra en el comedor Singapur el espacio ideal para tus momentos especiales. Este modelo te encantará ya que cuenta con un diseño completamente moderno, además la tonalidad gris le dará a tu decoración un aspecto elegante. El espacio para tus comidas ya no será un problema debido a que implementa 4 sillas las cuales se encuentran tapizadas con un material tipo lino el cual dará una suave sensación al taco dando un mayor confort. Incorpora una cubierta de cristal generando un contraste de diseños junto con la base del comedor.','MDF',2,6259,30,'Comedor para 4 personas','Se recomienda utilizar un paño limpio húmedo sólo con agua. Cualquier otro producto puede ir eliminando el brillo de la cubierta hasta dejarla opaca.','90X50X48','https://www.mueblesamerica.mx/img/1024/1024/resize/O/S/OSOM00014_x1_1.jpg','https://www.mueblesamerica.mx/img/1024/1024/resize/O/S/OSOM00014_x3_1.jpg','https://www.mueblesamerica.mx/img/1024/1024/resize/o/s/osom00014_g.jpg', NOW(), NOW());
INSERT INTO producto VALUES(6,'Comedor De Jardin CLAUDE','ZMAEKV2027','Complementa los muebles y accesorios de tu hogar con los mejores diseños y modelos como el COMEDOR CLAUDE que incluye 7 piezas 1913 incorpora 6 cojines decorativos en color GRIS, además de darle un toque decorativo a tu hogar te brinda la comodidad de degustar tus alimentos de manera cómoda. Este comedor y las sillas son fabricados en METAL/RATTAN SINTETICO. No incluye sombrilla','METAL/RATTAN SINTETICO',2,15890,30,'Comedor de jardin/exteriores para 6 personas.','Se pueden lavar con agua corriente y un trabo, procurar no usar hidrolavadora. ','72X98X178','https://www.mueblesamerica.mx/img/1024/1024/resize/3/0/307A00003_x1_1.jpg','https://www.mueblesamerica.mx/img/1024/1024/resize/3/0/307A00003_x2_1.jpg','https://www.mueblesamerica.mx/img/1024/1024/resize/3/0/307a00003_d.jpg', NOW(), NOW());
INSERT INTO producto VALUES(7,'MESA DE COMEDOR TORI - Fabricación Especial','ZMAEKV2028','Disfruta de comidas y reuniones inolvidables a lado de tu familia y/o amigos en la mesa de mármol Tori. Mesa para comedor con un diseño único por su combinación de materiales. Cubierta de mármol que contrasta a la perfección con una base de acero inoxidable con madera de roble laqueada en color negro. ¿Lo mejor de esta línea? El diseño de su base. Haz de tu casa un lugar sofisticado con las demás piezas de la línea Tori.','Estructura de madera sólida de roble y acero para aportar una mayor rigidez, estabilidad y soporte a la superficie de mármol.',6,8790,26,'Mesa comedor.','Se recomienda utilizar un paño limpio húmedo sólo con agua. Cualquier otro producto puede ir eliminando el brillo de la cubierta hasta dejarla opaca.','74x240x120','https://mobica.vtexassets.com/arquivos/ids/176138-1200-auto?v=637813150131530000&width=1200&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/176139-1200-auto?v=637813150196470000&width=1200&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/176140-1200-auto?v=637813150281000000&width=1200&height=auto&aspect=true', NOW(), NOW());
