INSERT INTO producto VALUES(19,'Comedor Niza Nogal','ZMAEKV2040','Comedor fabricado en madera industrializada. Grabado de vetas en cubierta y pedestales que le dan un gran estilo. Cuenta con 2 modelos de sillas para complementar: respaldo en barrotes y respaldo tapizado','MDF',2,9990,26,'Comedor para 6 personas','Se recomienda utilizar un paño limpio húmedo sólo con agua. Cualquier otro producto puede ir eliminando el brillo de la cubierta hasta dejarla opaca.','77x180x100','https://dico.com.mx/media/catalog/product/cache/ddfdab190e55251eefb307178e423bf7/c/o/com45924k1-kit-d-f-03-w.jpg','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/c/o/com45924k1-niza-plus-nogal-mesa-comedor-180mts5_3.jpg','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/c/o/com45924k1-niza-plus-nogal-mesa-comedor-180mts4_3.jpg', NOW(), NOW());
INSERT INTO producto VALUES(20,'Comedor Tiara Con Sillas Gris','ZMAEKV2041','Comedor moderno, fabricado en su base en madera sólida y cubierta en melamina texturizada en terminado semi mate. Silla con patas estilo Italiano y suave tela con capitoneado en respaldo y espuma suave. El tamaño de la mesa permite alojar hasta ocho comensales.','Madera',2,12890,29,'Comedor para 6 personas','Se recomienda utilizar un paño limpio húmedo sólo con agua. Cualquier otro producto puede ir eliminando el brillo de la cubierta hasta dejarla opaca.','86x90x180','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/c/o/comedor-tiara-blanco-silla-tiara-gris-moderno-decorado-COM35347K1-3.jpg','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/c/o/comedor-tiara-blanco-silla-tiara-gris-moderno-COM35347K1-2.jpg','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/m/e/mesa-tiara-blanco-moderno-COM35348C1-1_2.jpg', NOW(), NOW());
INSERT INTO producto VALUES(21,'Comedor Luxor','ZMAEKV2042','Comedor con mesa fabricada en madera industrializada y acabado en melamina sincronizada en color pino malibú. Acabado tipo concreto que contrasta a la perfección. Sillas tapizadas en tela tipo lino de gran durabilidad con disponibilidad de colores y patas con fino acabado en tono tabaco.','MDF/Melamina',2,17890,29,'Comedor para 4 personas','Se recomienda utilizar un paño limpio húmedo sólo con agua. Cualquier otro producto puede ir eliminando el brillo de la cubierta hasta dejarla opaca.','79x160x100','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/l/u/luxor_comedor_1.60_mts_1_.jpg','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/c/o/com416371_luxor_mesa_1.60x1.00_mts1_1_2.jpg','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/c/o/com416371_luxor_mesa_1.60x1.00_mts2_1_2.jpg', NOW(), NOW());
INSERT INTO producto VALUES(22,'Comedor Anka','ZMAEKV2043','Comedor de madera industrializada con acabado en melamina texturizada. Pedestal fabricado en metal que aporta gran resistencia y solidez. Sillas y banca fabricadas en combinación de madera de pino y respaldo metálico cruzado. Asiento en tela con detalles de tachuelas.','Pino/Metal',2,22980,30,'Comedor para 8 personas','Se recomienda utilizar un paño limpio húmedo sólo con agua. Cualquier otro producto puede ir eliminando el brillo de la cubierta hasta dejarla opaca.','76x240x120','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/a/n/anka_comedor_acercamienot.jpg','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/c/o/comedor_anka_1.jpg','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/c/o/comedor_anka_4.jpg', NOW(), NOW());
INSERT INTO producto VALUES(23,'Comedor Triangular Parker Chocolate','ZMAEKV2044','Atractivo comedor con cubierta de cristal templado de 10 mm de grosor y cubierta adicional tipo esmerilado en su parte baja. Estructura metálica de gran resistencia, en conjunto con sus sillas tapizadas en tacto piel y patas metálicas cromadas, hacen de este un gran conjunto para tu espacio.','Metal/Vidrio',2,8790,30,'Comedor para 6 personas','Se recomienda utilizar un paño limpio húmedo sólo con agua. Cualquier otro producto puede ir eliminando el brillo de la cubierta hasta dejarla opaca.','76x120x120','https://dico.com.mx/media/catalog/product/cache/ddfdab190e55251eefb307178e423bf7/p/a/parker_ketch_negro_comedor-zoom.jpg','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/c/o/comedor-moderna-cubierta-cafe-cristal-parker_com17924k0-c-f-01-w_1.jpg','https://dico.com.mx/media/catalog/product/cache/e5313a059d82e47a0dd0c73b13afb6be/c/o/comedor-moderna-cubierta-cafe-cristal-parker_com17924k0-c-d-02-w_1.jpg', NOW(), NOW());
INSERT INTO producto VALUES(24,'Silla Nora Cartier Beige 04 Fabricación Especial','ZMAEKV2045','Silla con estructura de madera sólida para comedor. Da el toque elegante a tu comedor con esta silla estilo clásico. Por su color, es muy fácil de combinar con distintos estilos y materiales. Respaldo y asiento suave, con relleno espuma.','Silla con estructura de madera sólida.',9,4995,31,'Asiento y respaldo con relleno espuma tapizado en tela color gris claro.','No utilizar solventes ni químicos, para evitar dañar la tela. Proteger del polvo y ambientes exteriores.','95, 56, 60','https://mobica.vtexassets.com/arquivos/ids/171462-800-auto?v=637333708641200000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/170690-800-auto?v=637242223511900000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/170691-800-auto?v=637242223805500000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(25,'Silla Blanca con ruedas Quincy','ZMAEKV2046','Silla de diseño y materiales vanguardistas, que por su forma y colores será un buen asiento para tu oficina o escrito de hogar. Con su altura regulable se adaptará a tus necesidades. Combínala con alguno de nuestros escritorios como el Atreo, para darle un estilo único a tu oficina.','Patas de acero inoxidable que por su resistencia a la corrosión tienen mayor durabilidad.',9,1745,27,'Altura regulable, adaptable a las dimensiones y necesidades del usuario','Evitar uso de solventes y cera Limpiar con limpiador de vidrios o espuma de jabón','90, 57, 61','https://mobica.vtexassets.com/arquivos/ids/162447-800-auto?v=636529268493300000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/167347-800-auto?v=636887165434830000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/167348-800-auto?v=636887165584330000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(26,'Silla Multiusos Lumi Azul','ZMAEKV2047','La silla Lumi es un elemento que no debe faltar en tu oficina. Su diseño ergonómico no solo brinda comodidad, también le da un toque de estilo a tu espacio laboral. Si se trata de proyectar modernidad y estilo, nuestra Silla Lumi con ruedas es la opción que estás buscando.','Estructura de Polipropileno en colores blanco, verde y rosa.',9,3500,24,'Base con regulación de altura con pistón de gas.','Limpiar con un paño húmedo.','73, 50, 54','https://mobica.vtexassets.com/arquivos/ids/165788-800-auto?v=636797322786770000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/165638-800-auto?v=636791979586170000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/165785-800-auto?v=636797322515670000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(27,'Silla de comedor Gordon','ZMAEKV2048','Complementa la decoración de tu comedor o estudio con Gordon, nuestra silla de diseño contemporáneo. Fabricada con patas de acero inoxidable color negro y estructura de piel PU en color camel. ¿Lo mejor? La suavidad al tacto de su asiento y respaldo.','Base / patas de metal color negro. Tapiz de piel PU.',2,2245,24,'Silla para comedor o estudio.','Limpiar con un paño suave semi húmedo. No utilizar aceites.','43, 55, 82','https://mobica.vtexassets.com/arquivos/ids/176615-800-auto?v=637865065739000000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/175531-800-auto?v=637787296539670000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/175532-800-auto?v=637787296641700000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(28,'Silla Enara Burdeos Iron Nogal Lava','ZMAEKV2049','Haz de tu comedor un espacio de diseño con la silla Enara. Se distingue por la armonía entre la línea de sus patas y el tapizado acojinado de su asiento y respaldo, haciéndola una pieza elegante que va perfecto con cualquier estilo y tipo de mesa.','Estructura de madera sólida y chapa de Nogal.',2,3745,26,'Silla para comedor tapizada en tela color gris.','No usar jabón, abrillantadores o aceites. Mantener lejos de la humedad e intemperie.','90, 45, 56','https://mobica.vtexassets.com/arquivos/ids/175629-800-auto?v=637788508197100000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/175630-800-auto?v=637788508311670000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/175631-800-auto?v=637788508436930000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(29,'Silla con Brazo Day Tripper','ZMAEKV2050','Day Tripper es la nueva línea de estilo escandinavo que móbica tiene para ti. Complementa la decoración de tu comedor con las sillas Day Tripper. Diseñadas con estructura de madera sólida de Álamo con acabado semi mate. Respaldo y asiento con relleno espuma y tapiz color negro. ','Sillas de madera sólida de álamo.',2,3995,30,'Con asiento y respaldo tapizado en poliester color negro, relleno de espuma.','Evitar exponer en ambientes exteriores y del contacto directo con el sol. Limpiar con un paño semi húmedo. No usar jabones ni químicos limpia telas.','81, 60, 60','https://mobica.vtexassets.com/arquivos/ids/173882-800-auto?v=637588666982470000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/173883-800-auto?v=637588667052670000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/173884-800-auto?v=637588667206470000&width=800&height=auto&aspect=true', NOW(), NOW());
