INSERT INTO producto VALUES(31,'Silla Bianca','ZMAEKV2052','Silla sin brazos para comedor. Da el toque de diseño a tu comedor con esta silla estilo contemporáneo minimalista. Por su color, es muy fácil de combinar con distintos estilos y materiales. Respaldo y asiento suave.','Asiento y respaldo con relleno espuma tapizado en tela color gris oscuro.',2,4495,28,'Silla con estructura de madera sólida.','No utilizar solventes ni químicos, para evitar dañar la tela. Proteger del polvo y ambientes exteriores.','85, 61, 51','https://mobica.vtexassets.com/arquivos/ids/175002-800-auto?v=637726826545900000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/171885-800-auto?v=637376909821400000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/171886-800-auto?v=637376910115830000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(32,'Silla Eileen','ZMAEKV2053','La mesa y las sillas de un comedor, son los muebles que dictarán el diseño de todo este cuarto. La silla Eileen, tiene un diseño vanguardista dado por su forma original.Diseño sobrio, elegante y moderno que le dará un estilo inolvidable a tu comedor.','Base de Tzalam nacional y tapizada en tela tipo Cashmere gris.',2,3995,27,'Terminado mate.','Limpiar con trapo húmedo para retirar el polvo y aspirar la tapicería.','87, 50, 62','https://mobica.vtexassets.com/arquivos/ids/168279-800-auto?v=636958009853070000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/170183-800-auto?v=637160878190630000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/163957-800-auto?v=636673440708400000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(33,'Silla Timbo - Fabricación Especial','ZMAEKV2054','Silla para exteriores, resistente a cambios de clima. Está elaborada con madera especial para aumentar su durabilidad. Es cómoda para tomar un descanso. Combínala con mobiliario móbica.','Madera sólida de eucalipto de grandis, la cual es resistente a los carcomas y exteriores. Fabricación Especial',4,11192,24,'Artículo de fabricación especial, hecho a la medida. Cuenta con un acabado de jotoba, lo que hace a la madera resistente a hongos y termitas. Entrega a 45 días hábiles','Cuando el mueble se sienta áspero lijar ligeramente y aplicar con un paño de Polisten (repetir cada 3 meses)','87, 57, 44','https://mobica.vtexassets.com/arquivos/ids/161829-800-auto?v=636440163251330000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/161627-800-auto?v=636426340814030000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/161628-800-auto?v=636426340903470000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(34,'Silla Up Tzalam','ZMAEKV2055','La mesa y las sillas de un comedor, son los muebles que dictarán el diseño de toda esta habitación. Nuestra silla UP, tiene un diseño contemporáneo, que será vigente al paso del tiempo.El lugar perfecto para que tus invitados y tú pasen momentos inolvidables. Diseño sobrio, elegante y moderno que le dará un estilo inolvidable a tu comedor.','Base de Tzalam natural, asiento y respaldo relleno de hule espuma.',2,4995,27,'Tapizada en tela color gris.','Sacudir con un trapo.','81, 57, 57','https://mobica.vtexassets.com/arquivos/ids/171517-800-auto?v=637345672655330000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/168799-800-auto?v=637003703392030000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/168800-800-auto?v=637003703470670000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(35,'Silla Con Brazos Anatolli','ZMAEKV2056','Disfruta esos días al aire libre en tu jardín o terraza con la nueva línea Anatolli. Silla diseñada en aluminio, lo que la hace sumamente resistente a ambientes exteriores. Para mayor comodidad, respaldo y asiento tapizado en textileno apto para exterior. El toque de diseño y estilo, lo encontrarás en el detalle de madera de eucalipto en los ante brazos.','Asiento y respaldo tapizado en textileno para exterior. Con detalles en madera de eucalipto en antebrazos.',4,2245,26,'Silla para exterior con estructura de aluminio.','Limpiar con un paño semi húmedo. Para conservar intacta la tela por más tiempo, no exponer directamente al sol todo el tiempo.','90, 56.5, 62','https://mobica.vtexassets.com/arquivos/ids/174160-800-auto?v=637613765401230000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/174161-800-auto?v=637613765497900000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/174162-800-auto?v=637613765601700000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(36,'Silla obla-di','ZMAEKV2057','Disfruta comidas y cenas inolvidables a lado de tu familia y amigos con la línea de comedor Obla-Di. Silla para comedor con estructura de madera sólida de Álamo y asiento tapizado en tela color gris oxford. Da a tu comedor el toque sobrio y elegante que necesita. Complementa la decoración de tu comedor con los demás productos de la línea Obla-Di.','Asiento tapizado en tela color gris oxford con relleno de espuma.',2,3995,29,'Silla para comedor de madera de Álamo con acabado semi mate Nogal.','No limpiar con productos para tela ni aceites para madera.','88, 50, 56','https://mobica.vtexassets.com/arquivos/ids/173700-800-auto?v=637577548976230000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/173701-800-auto?v=637577549108830000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/173703-800-auto?v=637577549335500000&width=800&height=auto&aspect=true', NOW(), NOW());
INSERT INTO producto VALUES(37,'Silla Kiev Aluminio Pata Negra','ZMAEKV2058','La mesa y las sillas de un comedor, son los protagonistas en cualquier cena, comida o reunión. Nuestra silla Kiev Aluminio, tiene un diseño elegante y sofisticado.Perfecta para que tus invitados y tú pasen momentos inolvidables. Diseño sobrio, elegante y moderno que le dará un estilo inolvidable a tu comedor.','Silla con estructura de madera sólida natural, respaldo y asiento relleno de espuma.',2,2995,29,'Acabado negro mate. Tapizada en tela.','Proteger del polvo y ambientes exteriores. En caso de limpieza, no utilizar solventes ni químicos.','90, 53, 60','https://mobica.vtexassets.com/arquivos/ids/170406-800-auto?v=637206081393170000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/170407-800-auto?v=637206081481530000&width=800&height=auto&aspect=true','https://mobica.vtexassets.com/arquivos/ids/170408-800-auto?v=637206081572570000&width=800&height=auto&aspect=true', NOW(), NOW());
