INSERT INTO producto VALUES(104,'Love Seat Arla Azul','ZMAEKV2125','Sofá moderno con un diseño muy confortable gracias a la amplia superficie de sus asientos. Fabricado con estructura de madera industrializada y tapizado en linato que te agradará por la suavidad de su tacto. Los brazos estrechos le aportan un aspecto refinado y además, dejan más espacio libre.','Tela',8,899,27,'Por su diseño y tamaño es ideal para cualquier espacio.','Aspira el polvo por lo menos una vez al mes. No expongas el mueble directamente a la luz del sol. En caso de algún derrame de líquidos, limpia con un paño o toalla seca al momento del derrame.','85X118X83','https://dico.com.mx/media/catalog/product/a/r/arla-ajuste.jpg','https://dico.com.mx/media/catalog/product/s/a/sala-arla-azul-moderna-decorada-6.jpg', NOW(), NOW());
